!function(e){e("#toggle-status").on("click",function(t){t.preventDefault(),e.ajax({method:"post",url:api_vars.rest_url+"wp/v2/posts/"+api_vars.post_id,data:{post_status:"draft"},beforeSend:function(e){e.setRequestHeader("X-WP-Nonce",api_vars.wpapi_nonce)}}).done(function(e){alert("Success! The status has been changed.")})})}(jQuery);